DROP TABLE IF EXISTS `stories`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `stories` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `users_id` bigint(20) unsigned NOT NULL,
  `create_time` timestamp NOT NULL DEFAULT current_timestamp(),
  `update_time` timestamp NOT NULL DEFAULT current_timestamp(),
  `storyname` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `storyintro` mediumtext COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Первая страница истории',
  `question` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `categories_id` bigint(20) unsigned NOT NULL,
  `access` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Ограничение доступа к редактированию/дописанию истории',
  PRIMARY KEY (`id`),
  KEY `fk_stories_users` (`users_id`),
  KEY `fk_stories_categories` (`categories_id`),
  CONSTRAINT `fk_stories_categories` FOREIGN KEY (`categories_id`) REFERENCES `categories` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_stories_users` FOREIGN KEY (`users_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=521 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Начальные страницы историй';
